"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Vesicoureteral reflux in adults (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/vesicoureteral-reflux-in-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H18619157\">",
"      <span class=\"h1\">",
"       What is vesicoureteral reflux?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Vesicoureteral reflux is a condition that causes some urine to flow in the wrong direction inside the body. Normally, urine that the kidneys make flows to the bladder through tubes called &ldquo;ureters.&rdquo; It then flows from the bladder out of the body. (All the organs that handle urine are called the &ldquo;urinary tract.&rdquo;) In",
"      <strong>",
"      </strong>",
"      people with vesicoureteral reflux, some of the urine flows backward from the bladder through the ureters to the kidneys (",
"      <a class=\"graphic graphic_figure graphicRef82960 \" href=\"UTD.htm?29/0/29696\">",
"       figure 1",
"      </a>",
"      ). This can happen in 1 or both of the ureters.",
"     </p>",
"     <p>",
"      This problem is most common in babies and young children. It often gets better or goes away as the child gets older. But it can also happen in older children and in adults.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18619174\">",
"      <span class=\"h1\">",
"       What causes vesicoureteral reflux?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Vesicoureteral reflux is caused by problems with the ureters or bladder. Most of the time, people are born with these problems. But the problems might not be found until the person is an adult. Other times, people who weren&rsquo;t born with vesicoureteral reflux get it later in life because of different conditions that affect the urinary tract.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18619189\">",
"      <span class=\"h1\">",
"       What are the symptoms of vesicoureteral reflux?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are no symptoms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18619204\">",
"      <span class=\"h1\">",
"       Why would a doctor think I have vesicoureteral reflux?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor might think you have vesicoureteral reflux for different reasons, including:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Frequent urinary tract infections (or &ldquo;UTIs&rdquo;) - These infections are usually caused by bacteria in the bladder or kidneys. If you get UTIs often, your doctor might want test you for vesicoureteral reflux. If you have both conditions at the same time, infected urine could flow backwards to the kidney and cause damage.&nbsp;",
"       </li>",
"       <li>",
"        Abnormal findings on an imaging test &ndash; People get imaging tests that take pictures of the inside of the body for different reasons. These tests include ultrasounds and MRIs. If some part of your urinary tract does not look normal on one of these tests, your doctor might want to test you for vesicoureteral reflux.",
"       </li>",
"       <li>",
"        High blood pressure &ndash; High blood pressure is very common, especially in older people and people who are overweight. It usually has nothing to do with vesicoureteral reflux, but in a few people, the 2 conditions are related. If your doctor thinks your high blood pressure is not caused by the usual problems, he or she might want to test you for vesicoureteral reflux.",
"       </li>",
"       <li>",
"        Kidney disease &ndash; Some people with kidney disease also have vesicoureteral reflux.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18619221\">",
"      <span class=\"h1\">",
"       Is there a test for vesicoureteral reflux?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, there is a test called a &ldquo;voiding cystourethrogram&rdquo; or &ldquo;VCUG.&rdquo; For this test, the doctor puts a small, flexible tube inside your bladder. Next the doctor fills the bladder with a special fluid that shows up on X-rays. You then urinate while an X-ray is taken. X-rays taken during this test show if the urine is flowing the wrong way.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18619236\">",
"      <span class=\"h1\">",
"       How is vesicoureteral reflux treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Antibiotics &ndash; Your doctor might want you to take antibiotics every day, but at a lower dose than if you really had an infection. These medicines can help keep you from getting a urinary tract infection.",
"       </li>",
"       <li>",
"        Surgery - Different kinds of surgery can stop the backflow of urine from the bladder to the kidney.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18619251\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?19/47/20210?source=see_link\">",
"       Patient information: Urinary tract infections in adults (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?16/0/16386?source=see_link\">",
"       Patient information: Neurogenic bladder in adults (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?31/18/32036?source=see_link\">",
"       Patient information: Urinary tract infections in adolescents and adults (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
