var title_f6_8_6286="Using powder inhalers 1 PI";
var content_f6_8_6286=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F51020%7EPI%2F59737&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F51020%7EPI%2F59737&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Technique for use of various dry powder inhalers - I",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Aerolizer",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove cover and hold the base of inhaler.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Twist mouthpiece in counter-clockwise direction.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove capsule from foil blister immediately before use and place capsule in the base of the inhaler.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hold the base of the inhaler and turn clockwise to close.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Simultaneously press both buttons once to pierce the capsule.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Exhale normally - do not exhale into the mouthpiece.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tilt head back slightly, hold device horizontal with the buttons on the left and right, place mouthpiece into the mouth, and close lips around mouthpiece.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breathe in rapidly and steadily, as deeply as possible; hold breath.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove device from mouth and exhale outside device.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Open chamber and examine capsule; if powder remains, repeat inhalation process.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        After use, remove and discard capsule, and cover mouthpiece; store device in cool, dry place.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diskhaler",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove mouthpiece cover and pull tray out from device.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Place disk on wheel with numbers facing up.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rotate disk by sliding tray out and in.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lift back of lid until fully upright so that needle pierces both sides of blister.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Keep device level while inhaling dose with a rapid and steady flow.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breathe in rapidly and steadily, as deeply as possible; hold breath.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove device from mouth and exhale outside device.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Brush off any powder remaining within device once every week; store device in cool, dry place.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diskus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Open the device and slide the lever until it clicks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Keep device level while inhaling dose.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breathe in rapidly and steadily, as deeply as possible; hold breath.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove device from mouth and exhale outside device; store device in cool, dry place.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Technique for use of various dry powder inhalers - II",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        HandiHaler",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Capsules should be stored in sealed blisters and only removed immediately before use.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Peel back the foil using the tab until one capsule is fully visible.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Open the dust cap by pulling it upwards, then open the mouthpiece.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Place the capsule in the center chamber (it does not matter which end of the capsule is placed in the chamber).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Close the mouthpiece firmly until you hear a click, leaving the dust cap open.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hold the HandiHaler with the mouthpiece upwards and press the piercing button completely in once and release.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breathe out completely. Do not breathe into the mouthpiece at any time.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Close your lips tightly around the mouthpiece.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breathe in rapidly and steadily, as deeply as possible; hold breath.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        To ensure you get the full dose, repeat the inhalation from the HandiHaler as described.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        After the dose, open the mouthpiece, tip out the used capsule, and dispose. Do not handle used capsules.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Close the mouthpiece and dust cap for storage; store device in cool, dry place.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Turbuhaler",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Twist and remove cover.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hold inhaler upright with mouthpiece facing up.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Turn grip right then left until it clicks.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inhaler may be held upright or horizontal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breathe in rapidly and steadily, as deeply as possible; hold breath.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove device from mouth and exhale outside device.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Replace cover and twist to close; store device in cool, dry place.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Twisthaler",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hold the inhaler straight up with the pink portion (the base) on the bottom.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove the cap while it is in the upright position to make sure you get the right amount of medicine with each dose.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hold the pink base and twist the cap in a counter-clockwise direction to remove it.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        As you lift off the cap, the dose counter on the base will count down by 1. This action loads the medicine that you are now ready to inhale.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Make sure the indented arrow located on the white portion (directly above the pink base) is pointing to the dose counter.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breathe out normally - do not exhale into the device.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Place the mouthpiece into your mouth, with the mouthpiece facing towards you, and close your lips tightly around it.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inhale dose with a rapid and steady flow while holding the Twisthaler horizontal.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove the mouthpiece from your mouth and hold your breath for 5 to 10 seconds (or as long as you comfortably can).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When you exhale, be sure that you are not exhaling into the device",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Immediately replace the cap and turn in a clockwise direction as you gently press down until you hear a click.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Firmly close the Twisthaler to assure that your next dose is properly loaded.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Be sure that the arrow is in line with the dose-counter window.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Store device in cool dry place.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The dose counter displays the number of doses remaining. When the unit reads 01, this indicates the last remaining dose. When the counter reads 00, the unit must then be discarded.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
